import { Link,Routes, Route, useNavigate } from 'react-router-dom';
import Aestheticism from "./Aethesticism";
import SelectComponent from "./SelectComponent"
const Personality = () => {


    
    const navigate = useNavigate();
    const [input,setInput] = useState({
        title:'',
      })
    const [selectedOption, SetselectedOption] = useState('');
    function handleClick(event) {
        event.preventDefault();
        console.log(input);
        navigate("/personality");
    }
    function handleChange(event){
        console.log(event.target);
        const{name, value} = event.target;
        setInput(prevInput => {
            return {
                ...prevInput,
                [name]:value
            }
        })
    }
    return (
        <React.Fragment>
            <Link to= '/aethesticism'></Link>
            <Routes>
            <Route path = "/aethesticism" element={<Aestheticism />}></Route>
            </Routes>
            <div className='main-container'>
            <span className='text'>Personality</span>

            <form>
            <div className="form-group">
            <input onChange={handleChange} name="title" value = {input.title} autoComplete="off" className="form-control" placeholder="Your Gmail"></input>
            </div>
            
            <button onClick={handleClick} className="btn btn-lg btn-info">Add Gmail</button>
        
            <SelectComponent 
            options = {options}
            placeholder ={"type to search"}
            onChange={(item)=>SetselectedOption(item)}
            selectedKey={selectedOption}
            />
            </form>

            <button className="btn-2" onClick={()=>navigate("/aethesticism")}> 
            <span className="btn2_text">Next One !</span>
            </button>
            </div>
        </React.Fragment>
    )

   
};
export default Personality
